const Events = () => {
  return (
    <div>
      <section className={styles.events}>
        <div className={styles.container}>
          <div class="text-row">
  <h2>Our New <span>Events</span></h2>
  <p>Only in 2021...</p>
</div>
        </div>
      </section>
    </div>
  );
};

export default Events;
